import React from 'react';
import './HomePage.css';
import footballManagerLogo from './Statement_BH_3.png';
import { Link } from "react-router-dom";
import backgroundVideo from './background.mp4'; // Video dosyasını import edin

const Homepage = () => {
  return (
    <div className="homepage-container">
      {/* Arka plan videosu */}
      <video className="background-video" autoPlay loop muted>
        <source src={backgroundVideo} type="video/mp4" />
        Your browser does not support the video tag.
      </video>

      {/* İçerik */}
      <p>Football Manager Scout</p>
      <div className="buttons-and-logo">
        <div className="left-buttons">
          <Link to="/Players" className="button">Players</Link>
          <Link to="/Clubs" className="button">Clubs</Link>
          <Link to="/favourites" className="button">Favourites</Link>
        </div>

        <div className="logo-container">
          <img src={footballManagerLogo} alt="Football Manager Logo" className="logo" />
        </div>

        <div className="right-buttons">
          <Link to="/leagues" className="button">Leagues</Link>
          <Link to="/wonderkids" className="button">Wonderkids</Link>
          <Link to="/freetransfers" className="button">FreeTransfers</Link>
          <Link to="/login" className="button">Login</Link>
        </div>
      </div>
    </div>
  );
};

export default Homepage;
